(1, 'Labial Rojo', 'labial-rojo', 'LB12345', 400, 10, '<p>Labial Rojo intenso</p>', 'labial rojo intenso', 'products/2p1Kv6OipPN2G00Ji4HABSrlec3dpeiPHZrvKlqg.png', 2, '[]', 2, 45, 50, 58, 5, '2025-02-10 21:50:21', '2025-02-11 02:59:39', NULL),
(2, 'Base', 'base', 'BS12345', 800, 12, '<p>Uso: Agitar bien antes de usar. aplique la base de manera uniforme por todo el rostro, para un acabado de alta cobertura use la brocha 102 Foundation Blender Brush.<br />\r\n<br />\r\nIngredients: Aqua, Cyclopentasiloxane, Isododecane, Ethylhexyl Palmitate, Glycerin, Squalane, Peg-30 Dipolyhydroxystearate, Magnesium Sulfate, Cetyl Peg/Ppg-10/1 Dimethicone, Quaternium-18 Bentonite, Trimethylsiloxysilicate, Phenoxyethanol, Methylparaben, Propylparaben, Ci 77891, Ci 77492, Ci 77491, Ci 77499, Fragrance.&nbsp;</p>', 'Ingredients: Aqua, Cyclopentasiloxane, Isododecane, Ethylhexyl Palmitate, Glycerin, Squalane, Peg-30 Dipolyhydroxystearate, Magnesium Sulfate, Cetyl Peg/Ppg-10/1 Dimethicone, Quaternium-18 Bentonite, Trimethylsiloxysilicate, Phenoxyethanol, Methylparaben, Propylparaben, Ci 77891, Ci 77492, Ci 77491, Ci 77499, Fragrance.', 'products/NaTSIzRrhvIT5uOQNsrrksQJrftd5QkE1lzp8PCa.png', 2, '[]', 4, 45, 50, 59, 5, '2025-02-11 04:41:04', '2025-02-11 09:44:12', NULL),
(3, 'Paleta de sombras', 'paleta-de-sombras', 'S123456', 1212, 20, '<p>Uso: Aplique con la 202 Eyeshadow Blender Brush difuminando sobre el p&aacute;rpado hasta lograr la intensidad deseada.<br />\r\n<br />\r\nIngredients: Mica, Talc, Synthetic Fluorphlogopite, Magnesium Stearate, Dimethicone, Silica, Ethylhexyl Palmitate, Calcium Aluminum Borosilicate, Mineral Oil, Hydrogenated Polyisobutene, Polyethylene, Kaolin, Synthetic Wax, Bis-Diglyceryl Polyacyladipate-2, Isononyl Isononanoate, Methylparaben, Propylparaben, Tin Oxide, Ci 77891, Ci 77491, Ci 77499, Ci 15850, Ci 15985, Ci 19140, Ci 77266, Ci 16035, Ci 45410, Ci 77007, Ci 77492, Ci 47005, Ci 77742, Ci 77820, Ci 61570.</p>', 'Aplique con la 202 Eyeshadow Blender Brush difuminando sobre el párpado hasta lograr la intensidad deseada.', 'products/Z12Iz3wDrdWMOB0IV5F2uf0VVFvx83HqiA3vJaXW.png', 2, '[]', 4, 45, 50, 60, 10, '2025-02-11 04:43:38', '2025-02-11 09:44:30', NULL),
(4, 'Primer', 'primer', 'PR12334', 2334, 30, '<p>Esta prebase perfeccionadora alisa la piel, minimiza los poros y crea una base ideal para el maquillaje. Su f&oacute;rmula ligera y no grasa es adecuada para todo tipo de piel.</p>', 'primer matificante controla el brillo, reduce la apariencia de los poros y proporciona hidratación durante todo el día', 'products/uQUTFmtnpLdBAuRCdFCf0Um4WiAshT0t1Iy5xzzY.png', 2, '[]', 3, 45, 51, 71, 6, '2025-02-11 04:49:09', '2025-02-11 09:50:21', NULL),
(5, 'Mascarilla de noche para labios EX 20 g - Pomelo', 'mascarilla-de-noche-para-labios-ex-20-g-pomelo', 'MS23345', 990, 18, '<p>Esta mascarilla para labios, dise&ntilde;ada para usar durante la noche, est&aacute; enriquecida con un complejo de frutos rojos, vitamina C y aceite de coco. Nutre eficazmente los labios, dej&aacute;ndolos visiblemente suaves y tersos.</p>', 'Esta mascarilla para labios, diseñada para usar durante la noche', 'products/SnGHaYuQd1ToKKBiKlAt7jmYjHytOLqsb8E31ecG.png', 2, '[]', 5, 45, 51, 71, 7, '2025-02-11 04:53:59', '2025-02-11 09:57:08', NULL),
(6, 'Crema concentrada de ceramidas Ato 200 ml', 'crema-concentrada-de-ceramidas-ato-200-ml', 'CC12345', 786, 14, '<p>Esta crema, formulada con el complejo patentado Ceramide Skin Complex, proporciona una hidrataci&oacute;n profunda y beneficios calmantes tanto para el rostro como para el cuerpo. Su f&oacute;rmula refrescante y de r&aacute;pida absorci&oacute;n no contiene ingredientes de origen animal, aceites minerales, colorantes artificiales, fragancias ni parabenos.</p>', 'Esta crema, formulada con el complejo patentado Ceramide Skin Complex, proporciona una hidratación profunda', 'products/3sjsAlGvejcxDJ0ppojv521vbx9QFQQA5SIfjrkH.png', 2, '[]', 5, 45, 51, 72, 4, '2025-02-11 04:56:52', '2025-02-11 09:57:30', NULL),
(7, 'Bolso de Hombro Ovalado', 'bolso-de-hombro-ovalado', 'BH1213', 2500, 35, '<p>Bolso formato de hombro en forma ovalada. Detalle de pespunte en el corte. Asa de hombro con apliques met&aacute;licos. Bolsillo interior con cremallera. Cierre mediante im&aacute;n.<br />\r\n<br />\r\nAltura x Ancho x Fondo: 19,5 x 32 x 7 cm</p>\r\n\r\n<ul>\r\n	<li>Composici&oacute;n, cuidados &amp; origen</li>\r\n	<li>Ver disponibilidad en tienda</li>\r\n	<li>Env&iacute;os, cambios y devoluciones</li>\r\n</ul>', 'Bolso formato de hombro en forma ovalada. Detalle de pespunte en el corte. Asa de hombro con apliques metálicos', 'products/q4eQWECbfUCrePGaj97fNIkQ4kr7g6jt72tJ0sec.png', 2, '[]', 1, 46, 53, 64, 7, '2025-02-11 05:00:17', '2025-02-11 10:00:31', NULL),
(8, 'Vestido Corto Puntos Botones Dorados', 'vestido-corto-puntos-botones-dorados', 'GT81287', 3000, 50, '<p>Vestido de cuello solapa y manga por debajo del codo. Bolsillos delanteros de plastr&oacute;n. Cierre frontal con botones dorados.</p>\r\n\r\n<ul>\r\n	<li>Composici&oacute;n, cuidados &amp; origen</li>\r\n	<li>Ver disponibilidad en tienda</li>\r\n	<li>Env&iacute;os, cambios y devoluciones</li>\r\n</ul>', 'Vestido de cuello solapa y manga por debajo del codo. Bolsillos delanteros de plastrón. Cierre frontal con botones dorados.', 'products/iByE4z6aPy1zw90btTG1TGr4XnWhVXiqkQbbqM4y.png', 2, '[]', 1, 46, 54, 65, 9, '2025-02-11 05:02:35', '2025-02-11 10:20:11', NULL),
(9, 'Zapato Tacón Pulsera Hebilla', 'zapato-tacon-pulsera-hebilla', 'TC122344', 1340, 28, '<p>Zapato con tac&oacute;n fino. Detalle de tira con hebilla en la parte delantera. Cierre mediante hebilla en la pulsera al tobillo. Acabado en punta.<br />\r\n<br />\r\nAltura del tac&oacute;n: 10 cm</p>', 'Zapato con tacón fino. Detalle de tira con hebilla en la parte delantera. Cierre mediante hebilla en la pulsera al tobillo. Acabado en punta.', 'products/zAMdutbqKMOCAb1X466clWXUUw3Q5G2Kbz5nlQ72.png', 2, '[]', 1, 46, 55, 66, 12, '2025-02-11 05:04:28', '2025-02-11 10:21:39', NULL),
(10, 'Zapatillas Deportivas Running Rejilla', 'zapatillas-deportivas-running-rejilla', 'ZD2344', 2778, 45, '<p>Zapato tipo deportivas estilo running. Cuerpo en combinaci&oacute;n de colores y materiales. Suela en contraste. Cierre mediante cordones.<br />\r\n<br />\r\nAltura de la suela: 3,5 cm</p>', 'Zapato tipo deportivas estilo running. Cuerpo en combinación de colores y materiales. Suela en contraste.', 'products/k78thtNfbyQd72B4aNwR5TZPiX46fDT7zFo6s1Qc.png', 2, '[]', 1, 46, 55, 67, 15, '2025-02-11 05:06:19', '2025-02-11 10:21:28', NULL),
(11, 'Juego de Toalla y Toallón Paz Air', 'juego-de-toalla-y-toallon-paz-air', 'T4566', 456, 10, '<p>Juego de toall&oacute;n de ba&ntilde;o y toalla de mano extra large lisas, con una sofisticada guarda en cadena, compuestas por puro algod&oacute;n de 440 gramos/m&sup2;, destacando por su incre&iacute;ble suavidad, densidad y capacidad de absorci&oacute;n, ofreciendo una experiencia de secado y comodidad. Este juego proporciona un confort y elegancia inigualable.</p>\r\n\r\n<ul>\r\n	<li><strong>Composici&oacute;n:</strong>&nbsp;100% algod&oacute;n de 440 gramos/m2.</li>\r\n	<li><strong>Medidas:</strong>&nbsp;Toall&oacute;n 90 x 150 cm / toalla de mano 50 x 90 cm.</li>\r\n	<li><strong>Incluye:</strong>&nbsp;2 piezas.</li>\r\n</ul>\r\n\r\n<p><strong>Cuidados:</strong>&nbsp;te recomendamos hacer un lavado antes del primer uso de tu toalla. Durante el lavado diario es ideal evitar el exceso de suavizantes ya que pueden dejar residuos y crear una textura m&aacute;s r&iacute;gida. Secar a la sombra, nuestras toallas no requieren planchado. Es importante seguir las instrucciones de lavado que cada producto tiene en la etiqueta.</p>\r\n\r\n<p>Al momento de elegir tus toallas, te recomendamos tener en cuenta su gramaje, la densidad de la toalla se mide en gramos/m2. Por sus cualidades este juego de toalla permite una gran absorci&oacute;n r&aacute;pida, proporciona un tejido de apariencia voluminosa, con mayor suavidad y alta calidad con respecto al hilo de algod&oacute;n tradicional. Ideal para que sientas la suavidad en tu piel en cada ba&ntilde;o que tomes.</p>', 'Juego de toallón de baño y toalla de mano extra large lisas, con una sofisticada guarda en cadena, compuestas por puro algodón de 440 gramos/m², destacando por su increíble suavidad, densidad y capacidad de absorción, ofreciendo una experiencia de secado y comodidad. Este juego proporciona un confort y elegancia inigualable.', 'products/ISATIwv0sZqwi1y63u4ybqfwdKgogIgpWGqMLkLO.png', 2, '[]', 6, 47, 56, 68, 20, '2025-02-11 05:09:30', '2025-02-11 10:21:15', NULL),
(12, 'Vela Aromática Vidrio Sándalo', 'vela-aromatica-vidrio-sandalo', 'VL12344', 370, 7, '<ul>\r\n	<li><strong>Composici&oacute;n:</strong>&nbsp;vela y vidrio.</li>\r\n	<li><strong>Medidas:</strong>&nbsp;6,5 de ancho x 6 cm de alto.</li>\r\n	<li><strong>Contiene:</strong>&nbsp;180 ml.</li>\r\n</ul>\r\n\r\n<p>Nuestras velas son perfectas para construir climas c&aacute;lidos, momentos de relajaci&oacute;n y descanso. Conoc&eacute; nuestra variedad de fragancias y eleg&iacute; la que m&aacute;s disfrutes. Ideal para los momentos de relax.</p>', 'Vela aromática con fragancia de sándalo en portavelas de vidrio.', 'products/lSImMAXTGwXVJdYEUuUJLO69RSwnRjzASxtgL05n.png', 2, '[]', 6, 47, 57, 69, 30, '2025-02-11 05:12:15', '2025-02-11 10:21:02', NULL),
(13, 'Difusor Aromático de Ambientes Urban Jungle', 'difusor-aromatico-de-ambientes-urban-jungle', 'DF266262', 1899, 27, '<ul>\r\n	<li><strong>Fragancia:</strong>&nbsp;lim&oacute;n, pomelo, gardenia, lavanda, musk, madera y coco.</li>\r\n	<li><strong>Contiene:</strong>&nbsp;100 ml.</li>\r\n</ul>\r\n\r\n<p>Nuestros aromas y esencias son perfectos para construir climas c&aacute;lidos, momentos de relajaci&oacute;n y descanso. Conoc&eacute; nuestra variedad de fragancias y eleg&iacute; la que m&aacute;s disfrutes. Ideal para los momentos de relax.</p>', 'Difusor de ambiente Urban Jungle. Incluye esencia y palillos.', 'products/Y47k3sivlushseQQLysGZI9KFWPvKdAKfp0XOAoS.png', 2, '[]', 3, 47, 57, 70, 68, '2025-02-11 05:13:53', '2025-02-11 10:20:49', NULL),
(14, 'Garmin Vivoactive 4S', 'garmin-vivoactive-4s', 'RT56654', 5029, 79, '<p>Con un tama&ntilde;o de esfera de 40mm, el&nbsp;<strong>smartwatch Vivoactive 4S de garmin</strong>&nbsp;es ideal para mujeres que tienen una mu&ntilde;eca fina. Dispone de una gama amplia de colores que van desde los blancos con rosa, al oro rosa pasando por el gris y el negro; y dan una posibilidad de combinaci&oacute;n muy grande al tener la opci&oacute;n de cambiar la correa por cualquiera del mercado.</p>\r\n\r\n<p>En t&eacute;rminos puramente t&eacute;cnicos, hay que decir que es un reloj inteligente muy completo. Posee&nbsp;<strong>monitores de todo tipo&nbsp;</strong>como el medidor de energ&iacute;a, estr&eacute;s, ox&iacute;geno en sangre, pulsaciones, respiraci&oacute;n, seguimiento de hidrataci&oacute;n, control del sue&ntilde;o, un largo etc&eacute;tera; destacando una aplicaci&oacute;n en Garming Conect App (para Android e IOS) para hacer un&nbsp;<strong>seguimiento del ciclo menstrual</strong>&nbsp;o pagar a trav&eacute;s de Garmin Pay.</p>', 'Con un tamaño de esfera de 40mm, el smartwatch Vivoactive 4S de garmin es ideal para mujeres que tienen una muñeca fina. Dispone de una gama amplia de colores que van desde los blancos con rosa, al oro rosa pasando por el gris y el negro; y dan una posibilidad de combinación muy grande al tener la opción de cambiar la correa por cualquiera del mercado.', 'products/JioWA9SpUiMJiPwbBsLxOBfnJOJPwyg0fSeA27U6.png', 2, '[]', 6, 74, NULL, NULL, 15, '2025-02-11 05:17:05', '2025-02-11 10:20:34', NULL),
(15, 'Dulce Pasion Arreglo', 'dulce-pasion-arreglo', 'D238829', 3883, 70, '<p>Dale una grata sorpresa a esa persona especial obsequi&aacute;ndole esta espectacular combinaci&oacute;n de 25 rosas rojas y 8 Ferreros Rocher que resultar&aacute; sin duda irresistible para sus ojos y su paladar. Todo empacado en una caja con un elegante dise&ntilde;o en color negro.</p>', 'Dale una grata sorpresa a esa persona especial obsequiándole esta espectacular combinación de 25 rosas rojas y 8 Ferreros Rocher que resultará sin duda irresistible para sus ojos y su paladar. Todo empacado en una caja con un elegante diseño en color negro.', 'products/1qi94EKMalZKfRVzGJPBzEnnrGa85anJagU80REP.png', 2, '[]', 1, 75, NULL, NULL, 4, '2025-02-11 05:19:57', '2025-02-11 10:20:21', NULL);
